import React from 'react'
import './dueDate.css'

function DueDate (props) {
  const { item: { id }} = props
  console.log(item)
  const handleDueDate = key => props.onDueDate(key)

  return (
    <button className='due-date-btn' onClick={() => handleDueDate(props.item.id)}>Due-Date</button>
  )
}

export default DueDate
